import React, { Component } from "react";
import SimpleStorage from "./build/contracts/SimpleStorage.json";
import getWeb3 from "./utils/getWeb3";
import ipfs from './ipfs';
import * as jsPDF from 'jspdf'

import "./App.css";

class App extends Component {
  state = { web3: null, accounts: null, contract: null, buffer: null, ipfsHash: '', name: ''};



    constructor() {
        super();
        // this.state = {
        //     articles: null
        // }
        this.onSearchImg = this.onSearchImg.bind(this);
    }


  componentDidMount = async () => {
    try {
      // Get network provider and web3 instance.
      const web3 = await getWeb3();
      // Use web3 to get the user's accounts.
      const accounts = await web3.eth.getAccounts();
      // Get the contract instance.
      const networkId = await web3.eth.net.getId();
      const deployedNetwork = SimpleStorage.networks[networkId];
      const instance = new web3.eth.Contract(
          SimpleStorage.abi,
        deployedNetwork && deployedNetwork.address,
      );
      console.log('instance', instance);

        this.onSearchImg = this.onSearchImg.bind(this);
      // Set web3, accounts, and contract to the state, and then proceed with an
      // example of interacting with the contract's methods.
      this.setState({ web3, accounts, contract: instance }, this.runExample);
    } catch (error) {
      // Catch any errors for any of the above operations.
      alert(
        `Failed to load web3, accounts, or contract. Check console for details.`,
      );
      console.error(error);
    }
  };


  runExample = async () => {
      const { contract } = this.state;
      var page1 = document.getElementById("pag1");
      page1.style.display = "none";
      var page2 = document.getElementById("pag2");
      page2.style.display = "none";
      var PNoRegistradoP = document.getElementById("PNoRegistrado");
      PNoRegistradoP.style.display = "none";

  };

  async login(event){
      const { web3, contract } = this.state;
      console.log('w3', web3);
      var docPersonaI = document.getElementById("docPersona").value;
      const response = await contract.methods.login(docPersonaI).call();
      if(response[0] !== "1"){
          console.log("login Successful");
          console.log(response);
          var numberOfDocs = Object.keys(response[2]).length;
          var hashDocs = [];
          var nameDocs = [];
          var PDocList = document.getElementById("docList");
          for (var i = 0; i < numberOfDocs; i++){
              var nameDoc = web3.utils.toAscii(response[3][i]);
              var hashDoc = web3.utils.toAscii(response[4][i]) + web3.utils.toAscii(response[5][i]);
              hashDocs.push(hashDoc);
              nameDocs.push(nameDoc);
              var idDoc = response[2][i];
              var para = document.createElement("P");               // Create a <p> element
              para.innerText = "This is a paragraph";

              var x = document.createElement("IMG");
              x.setAttribute("src", "https://cdn1.imggmi.com/uploads/2019/4/26/66b1d1cac47d4934a29f49506b8f9d91-full.jpg");
              x.setAttribute("width", "100");
              x.setAttribute("height", "100");
              x.setAttribute("alt", "PdfDoc");
              x.setAttribute("title", idDoc );
              x.onclick =  function (event, idDoc) {
                  //this.captureFile.bind(this)
                  //{this.onSearchImg()}
                  //this.onSearchImg();
                  //{this.onSearchImg()};
                      this.onSearchImg();
              };
              var y = document.createElement("h4");
              y.innerText = nameDoc;
              PDocList.appendChild(x);
          }
          console.log(hashDocs);
          console.log(nameDocs);
          var name = web3.utils.toAscii(response[1]);
          console.log(name);
          var PNoRegistradoP = document.getElementById("PNoRegistrado");
          PNoRegistradoP.style.display = "none";
          var page0 = document.getElementById("pag0");
          page0.style.display = "none";
          var page1 = document.getElementById("pag1");
          page1.style.display = "block";
      }else{
          var PNoRegistradoP = document.getElementById("PNoRegistrado");
          PNoRegistradoP.style.display = "block";
          document.getElementById("docPersona").value = "";
      }
  }

  captureFile(event){
      event.preventDefault();
      const file = event.target.files[0];
      this.state.name = event.target.files[0].name;
      console.log(this.state.name);
      const reader = new window.FileReader()
      reader.readAsArrayBuffer(file)
      reader.onloadend = () => {
          this.setState({buffer: Buffer(reader.result)});
          console.log('buffer', this.state.buffer);

      }
  }

  goBack(event){
      var page1 = document.getElementById("pag1");
      page1.style.display = 'block';
      var notFoundP = document.getElementById("notFoundPage");
      notFoundP.style.display = "none";
      var resultPageP = document.getElementById("resultPage");
      resultPageP.style.display = "none";
      document.getElementById("personalIdSearch").value = "";
  }

  async onSubmit (event){
      var personalIdA = document.getElementById("personalId").value;
      console.log(personalIdA);
      const { accounts, contract, name, web3 } = this.state;
      console.log(name);
      event.preventDefault();

      const answer = await ipfs.add(this.state.buffer);
      this.setState({ipfsHash: answer[0].hash});
      console.log('0',this.state.ipfsHash);
      var hash1 = this.state.ipfsHash.substring(0,23);
      var hash2 = this.state.ipfsHash.substring(23,46);

      const responseFalse = await contract.methods.addDocuments(personalIdA, web3.utils.fromAscii(name), web3.utils.fromAscii(hash1), web3.utils.fromAscii(hash2)).call();
      console.log(responseFalse);
      if(responseFalse[0] != 2 && responseFalse[0] != 3){
          var PResultPage = document.getElementById("resultPage");
          PResultPage.style.display = "block";
          var page1 = document.getElementById("pag1");
          page1.style.display = 'none';
          var page2 = document.getElementById("pag2");
          page2.style.display = 'block';
          console.log('grabar');
          const response = await contract.methods.addDocuments(personalIdA, web3.utils.fromAscii(name), web3.utils.fromAscii(hash1), web3.utils.fromAscii(hash2)).send({ from: accounts[0] });
      }else{
          if(responseFalse[0] == 2){
              var PResultPage = document.getElementById("resultPage");
              PResultPage.style.display = "none";
              var PNotFoundPage = document.getElementById("notFoundPage");
              PNotFoundPage.style.display = "block";
              var page1 = document.getElementById("pag1");
              page1.style.display = 'none';
              var page2 = document.getElementById("pag2");
              page2.style.display = 'block';
              var para = document.createElement("P");               // Create a <p> element
              para.innerText = "Documento ya se encuentra inscrito";
              PNotFoundPage.appendChild(para);
              //Documento ya se encuentra inscrito
              console.log("Documento ya se encuentra inscrito");
          }else{
              var PResultPage = document.getElementById("resultPage");
              PResultPage.style.display = "none";
              var PNotFoundPage = document.getElementById("notFoundPage");
              PNotFoundPage.style.display = "block";
              var page1 = document.getElementById("pag1");
              page1.style.display = 'none';
              var page2 = document.getElementById("pag2");
              page2.style.display = 'block';
              var para = document.createElement("P");               // Create a <p> element
              para.innerText = "El hash ya se encuentra registrado";
              PNotFoundPage.appendChild(para);
              //El hash ya se encuentra registrado
              console.log("El hash ya se encuentra registrado");
          }
      }

      document.getElementById("personalId").value = "";
  }

  async onSearch(event){
      var page1 = document.getElementById("pag1");
      page1.style.display = 'none';
      var resultPageP = document.getElementById("resultPage");
      const { contract, name, web3  } = this.state;
      console.log('onSearch');
      var personalIdSearchI = document.getElementById("personalIdSearch").value;
      var hash1 = this.state.ipfsHash.substring(0,23);
      var hash2 = this.state.ipfsHash.substring(23,46);
      console.log(personalIdSearchI);
      const response = await contract.methods.validateDocuments(personalIdSearchI, web3.utils.fromAscii(name), web3.utils.fromAscii(hash1), web3.utils.fromAscii(hash2)).call();
      if(response[0] == "5"){
          var PResultPage = document.getElementById("resultPage");
          PResultPage.style.display = "none";
          var PNotFoundPage = document.getElementById("notFoundPage");
          PNotFoundPage.style.display = "block";
          var page1 = document.getElementById("pag1");
          page1.style.display = 'none';
          var page2 = document.getElementById("pag2");
          page2.style.display = 'block';
          var para = document.createElement("P");               // Create a <p> element
          para.innerText = "Documento Sin alterar";
          PNotFoundPage.appendChild(para);
          console.log("Documento Sin alterar");
          //resultPageP.style.display = "block";
      }else{
          // resultPageP.style.display = "none";
          // var notFoundP = document.getElementById("notFoundPage");
          // notFoundP.style.display = "block";
          var PResultPage = document.getElementById("resultPage");
          PResultPage.style.display = "none";
          var PNotFoundPage = document.getElementById("notFoundPage");
          PNotFoundPage.style.display = "block";
          var page1 = document.getElementById("pag1");
          page1.style.display = 'none';
          var page2 = document.getElementById("pag2");
          page2.style.display = 'block';
          var para = document.createElement("P");               // Create a <p> element
          para.innerText = "Documento ha sido alterado";
          PNotFoundPage.appendChild(para);
          console.log("Documento ha sido alterado");
          //resultPageP.style.display = "block";
      }
      console.log('response', response)
      this.setState({ipfsHash: response})
  }

  async onSearchImg(event){
        console.log('llego');
        var page1 = document.getElementById("pag1");
        page1.style.display = 'none';
        var resultPageP = document.getElementById("resultPage");
        const { contract } = this.state;
        console.log('onSearch');
        var personalIdSearchI = document.getElementById("personalIdSearch").value;
        console.log(personalIdSearchI);
        const response = await contract.methods.get(personalIdSearchI).call();
        if(response !== ""){
            resultPageP.style.display = "block";
        }else{
            resultPageP.style.display = "none";
            var notFoundP = document.getElementById("notFoundPage");
            notFoundP.style.display = "block";
        }
        console.log('response', response)
        this.setState({ipfsHash: response});

      var doc = new jsPDF();

      doc.addImage('data:image/png;base64,', 'PNG', 15, 50, 180, 180);


      var title = 'TCS Activos Digitales';
      var subtitle = 'Tcs certifica la existencia del documento';
      var name = "Nombre:";
      var timestamp = "TimeStamp:";
      var ipfsHash = "IpfsHash:";
      var nameVar = "Soy un archivo Pdf";
      var timestampVar = "02/05/2019";
      var ipfsHashVar = "QmUktqUz211J9pYXh5MV1eze1YduFx5Wubwq9qLFVbaYFa ";

      doc.text(title, 85, 30);
      doc.text(subtitle, 65, 50);
      doc.text(name, 10, 80);
      doc.text(nameVar, 50, 80);
      doc.text(timestamp, 10, 90);
      doc.text(timestampVar, 50, 90);
      doc.text(ipfsHash, 10, 100);
      doc.text(ipfsHashVar, 50, 100);


      doc.save('a4.pdf');
  }

  render() {
    if (!this.state.web3) {
      return <div>Loading Web3, accounts, and contract...</div>;
    }
    return (
      <div className="App">
          <br/>
          <br/>
          <br/>
        <h1>Tcs Activos Digitales</h1>
        <br/>
        <br/>
        <div id="pag0">
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
            <div id="PLogin">
                <h2>Digita tu documento</h2>
                <input type="text" id="docPersona"/>
                <form onSubmit={this.onSubmit}>
                    <br/>
                    <button type="button"onClick={this.login.bind(this)}>Ingresar</button>
                </form>
            </div>
            <div id="PNoRegistrado">
                <br/>
                <h3>No te encuentras registrado</h3>
            </div>
        </div>
        <div id="pag1">
            <div id="docList">
                <h3>Documentos digitalizados</h3>
            </div>
            <hr width="50%"/>
            <div id="add">
                <h3>Agrega tu documento</h3>
                <input name="capture" type="file" onChange={this.captureFile.bind(this)}/>
                <h3>Id del Documento</h3>
                <input type="text" id="personalId"/>
                <form onSubmit={this.onSubmit}>
                    <br/>
                    <button type="button"onClick={this.onSubmit.bind(this)}>Guardar</button>
                </form>
            </div>
            <br/>
            <hr width="50%"/>
            <div id="search">
                <h3>Validar Documento</h3>
                <h3>Id del Documento</h3>
                <input name="capture" type="file" onChange={this.captureFile.bind(this)}/>
                <br/>
                <input type="text" id="personalIdSearch"/>
                <br/>
                <form onSubmit={this.onSubmit}>
                    <br/>
                    <button type="button"onClick={this.onSearch.bind(this)}>Buscar</button>
                </form>
            </div>
        </div>
        <div id="pag2">
            <div id="resultPage">
                <div>
                    <p>Tu docuemnto digitalizado es:</p>
                    <iframe src={`https://ipfs.io/ipfs/${this.state.ipfsHash}`} width="800px" height="500px"></iframe>
                    <button type="button"onClick={this.goBack.bind(this)}>Volver</button>
                </div>
            </div>
            <div id="notFoundPage">
                <button type="button"onClick={this.goBack.bind(this)}>Volver</button>
            </div>
        </div>
      </div>
    );
  }
}

export default App;
